import React from 'react';
import { makeStyles } from '@mui/styles';
import { Paper, Typography, List, ListItem, ListItemText } from '@mui/material';

import './Profile.css';

const useStyles = makeStyles((theme) => ({
  profileContainer: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    padding: theme.spacing(4),
    background: `url('https://brandcurb.com/assets/web-design-development.webp')`,
    backgroundSize: 'cover',
  },
  profileCard: {
    maxWidth: 400,
    padding: theme.spacing(3),
    borderRadius: theme.spacing(2),
    background: 'rgba(255, 255, 255, 0.8)',
    textAlign: 'center',
  },
}));

const Profile = () => {
  const classes = useStyles();

  const profileDetails = {
    name: 'John Doe',
    age: 30,
    email: 'johndoe@example.com',
    occupation: 'Software Engineer',
    location: 'New York, USA',
    interests: ['Reading', 'Coding', 'Traveling']
  };

  return (
    <div className={classes.profileContainer}>
      <Paper elevation={3} className={`${classes.profileCard} Profile-bg`}>
        <Typography variant="h4" gutterBottom>
          Profile Details
        </Typography>
        <div>
          <List>
            <ListItem>
              <ListItemText primary="Name" secondary={profileDetails.name} />
            </ListItem>
            <ListItem>
              <ListItemText primary="Age" secondary={profileDetails.age} />
            </ListItem>
            <ListItem>
              <ListItemText primary="Email" secondary={profileDetails.email} />
            </ListItem>
            <ListItem>
              <ListItemText primary="Occupation" secondary={profileDetails.occupation} />
            </ListItem>
            <ListItem>
              <ListItemText primary="Location" secondary={profileDetails.location} />
            </ListItem>
            <ListItem>
              <ListItemText
                primary="Interests"
                secondary={
                  <List>
                    {profileDetails.interests.map((interest, index) => (
                      <ListItem key={index}>
                        <ListItemText primary={interest} />
                      </ListItem>
                    ))}
                  </List>
                }
              />
            </ListItem>
          </List>
        </div>
      </Paper>
    </div>
  );
};

export default Profile;
